import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import ColumnaIzquierda from './ColumnaIzquierda';
import ColumnaDerecha from './ColumnaDerecha';
import Estadisticas from './Estadisticas'; // Asegúrate de que este componente exista
// Importa otros componentes de página según sea necesario
import Footer from './Footer';
import './App.css';
import { VisibilityProvider } from '../context/VisibilityContext';

const App = ({ token, urn }) => {
    const [isCollapsed, setIsCollapsed] = useState(false);

    return (
        <VisibilityProvider>
            <Router>
                <div className="container-fluid">
                    <div className="row">
                        {/* Columna Izquierda */}
                        <div className={`col-${isCollapsed ? '1' : '2'}`}>
                            <ColumnaIzquierda isCollapsed={isCollapsed} handleCollapse={() => setIsCollapsed(!isCollapsed)} />
                        </div>

                        {/* Contenido Principal */}
                        <div className={`col-${isCollapsed ? '11' : '10'}`}>
                            <Switch>
                                <Route exact path="/" render={() => <ColumnaDerecha isCollapsed={isCollapsed} token={token} urn={urn} />} />
                                <Route path="/estadisticas" component={Estadisticas} />
                                <Redirect from="/visualizador" to="/" />
                                {/* Definir rutas adicionales aquí */}
                            </Switch>
                        </div>
                    </div>
                    <Footer />
                </div>
            </Router>
        </VisibilityProvider>
    );
};

export default App;
